description:
When exotic dancer Cassie (Sarah Allen) happens upon a drug deal gone bad, she steals the money and the drugs thinking she now has the funds to make her dream of moving to Paris come true. But waiting three days to get her passport proves tougher than she thought when everyone she knows from her ex-boyfriend, to her drug addict boss, to her lesbian lover, to the rightful owner of the money decides to get in on the action.
